describe('Wrapping Table Relayout issues on FormFill', () => {
    let editor: DocumentEditor = undefined;
    beforeAll(() => {
        document.body.innerHTML = '';
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        editor = new DocumentEditor({ enableEditor: true, isReadOnly: false, enableEditorHistory: true, enableLocalPaste: false });
        DocumentEditor.Inject(Editor, Selection, EditorHistory);
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.documentEditorSettings.formFieldSettings.formFillingMode = 'Inline';
        editor.appendTo('#container');
    });
    afterAll((done) => {
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
        setTimeout(() => {
            done();
        }, 1000);
    });
    it('Wrapping Table Relayout issues on FormFill', () => {
        editor.open(JSON.stringify(wrapTable));
        const wrapTable1X: number = (editor.documentHelper.pages[3].bodyWidgets[0].childWidgets[18] as TableWidget).x;
        const wrapTable2X: number = (editor.documentHelper.pages[3].bodyWidgets[0].childWidgets[20] as TableWidget).x;
        editor.selection.select('0;80;16', '0;80;16');
        editor.editor.insertText('Test');
        editor.selection.select('0;84;0;1;0;22', '0;84;0;1;0;22');
        editor.editor.insertText('Test');
        editor.selection.select('0;89;25', '0;89;25');
        editor.editor.insertText('Test');
        expect((editor.documentHelper.pages[3].bodyWidgets[0].childWidgets[18] as TableWidget).x).toBe(wrapTable1X);
        expect((editor.documentHelper.pages[3].bodyWidgets[0].childWidgets[20] as TableWidget).x).toBe(wrapTable2X);
    });
});